      <text id="162" justification="0" size="4" underlined="false">
        <text>In the default layout, a developer
or continuous integration server
would checkout the project_group_AB
from source control, and execute
fabricate from the project_group_AB
directory to get the projects A and B
from source control and build them.</text>
      </text>

      <textColor reference="169"/>
      <text id="170" justification="0" size="4" underlined="false">
        <text>In the development layout, a developer
would checkout the project_group_AB
from source control, and execute
fabricate from the project_group_AB
directory with the -Dlayout=dev to get 
the projects A and B from source 
control and build them.  This layout
was mainly added so that the projects
A, B and AB could be discretely added to 
a IDE (i.e. eclipse).</text>
      </text>
      <color reference="163"/>
    </NoteNode>

      <textColor reference="176"/>
      <text id="177" justification="0" size="4" underlined="false">
        <text>The depot is where the output of various output 
of the different builds go, .jar, .jar, .sar so that 
they can be looke up by dependent projects.
It can be specified by -Ddepot=somedir.  
When it is NOT specified it defaults to the directory
with fabricate.xml.  When a aggergrate layout is used
fabricate passes the depot to the various project groups.</text>
      </text>
